import re, time
import nltk
from nltk.corpus import stopwords
from nltk.stem import WordNetLemmatizer
from nltk.corpus import wordnet
import json
import sys

def get_wordnet_pos(tag):
    if tag.startswith('J'):
        return wordnet.ADJ
    elif tag.startswith('V'):
        return wordnet.VERB
    elif tag.startswith('N'):
        return wordnet.NOUN
    elif tag.startswith('R'):
        return wordnet.ADV
    else:
        return None

def split_camel_case(word):
    return re.sub('([a-z0-9])([A-Z])', r'\1 \2', word).split()

def clean_word(word):
    word = word.strip()
    cleaned_word = re.sub(r'[^a-zA-Z0-9]', ' ', word)
    cleaned_word = re.sub('\s+', ' ', cleaned_word)

    tokens = nltk.word_tokenize(cleaned_word)
    tagged_sent = nltk.pos_tag(tokens)

    wnl = WordNetLemmatizer()
    lemmas_sent = []
 
    for tag in tagged_sent:
        wordnet_pos = get_wordnet_pos(tag[1]) or wordnet.NOUN
        # if len()
        lemmas_sent.append(wnl.lemmatize(tag[0], pos=wordnet_pos))  #

    lemmas_sent = [word for word in lemmas_sent if word.isalpha() and word not in stopwords.words('english')]
    return lemmas_sent


class Tokens():
    def __init__(self, str, addr=None):
        self.token = clean_word(str)
        self.ltoken = [x.lower() for x in self.token]
        self.addr = addr
        self.src_addr = None
        self.score = 0

    def  __str__(self):
        res = ""
        if self.addr is not None:
            res += self.addr
        res += str(self.token)
        return res

    def matched(self, other):
        score = 0
        for word in self.ltoken:
            if word in other.ltoken:
                score += 1
        return score/len(self.token)

    def Jmatched(self, other):
        label1 = set(self.ltoken)
        label2 = set(other.ltoken)
        if(len(label2) > len(label1)):
            max_score = 0
            for x in range(0, len(label2)-len(label1)):
              sub_lable2 = set(other.ltoken[x:])
              jaccard = len(label1.intersection(sub_lable2))/len(label1.union(sub_lable2))
              if jaccard > max_score:
                  max_score = jaccard
        return len(label1.intersection(label2))/len(label1.union(label2))



class TokenMgr():
    def __init__(self):
        self.tokens = set()

    def add(self, token):
        self.tokens.add(token)

